import React, { Component } from 'react';
import './NavigationMenu.css';

interface MenuProps {
    links : Element[];
    logo : string;
};

interface Element {
    label : string;
    Element : string;
    active? : boolean;
};

interface MenuState {
    showForm : boolean;
};

class NavigationMenu extends Component<MenuProps, MenuState> {
    constructor(props : any) {
        super(props);

        this.state = {
            showForm: false
        };
    }

    showForm() {
        this.setState({
            showForm: !this.state.showForm
        });
    }

    render() {


        let ElementsMarkup = this.props.Elements.map((Element, index) => {
            let ElementMarkup = Element.active ? (
                <a className="menu__Element menu__Element--active" href={Element.Element}>{Element.label}</a>
            ) : (
                <a className="menu__Element" href={Element.Element}>{Element.label}</a>
            );

            return (
                <li key={index} className="menu__list-item">
                    {ElementMarkup}
                </li>
            );
        });

        return (

            <nav className="menu">
                <h1 style={{
                backgroundImage: 'url(' + this.props.logo + ')'
                }} className="menu__logo"></h1>


                <div className="menu__right">
                <h1>Purrfect Match </h1>



                    <ul className="menu__list">
                        {ElementsMarkup}
                    </ul>


                </div>
            </nav>
        );
    }
}

export default NavigationMenu;
